import React from 'react';
import {BrowserRouter,Route,Switch} from 'react-router-dom';

const App = () =>{
	return[
		<BrowserRouter>
			<Switch>
				<Route path="/">
					<div>
						<h1>Hola Mundo</h1>
					</div>
				</Route>
			</Switch>
		</BrowserRouter>
		]
		
}
export default App;
